import React from 'react';
import './TrackList.css';
import Track from '../Track/Track'

class TrackList extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div className="TrackList">
        <Track key={this.props.track.id} name={this.props.track.name} artist={this.props.track.artist} album={this.props.track.album} isRemoval={false}/>
        {/*tracks.map((item) => 
          console.log(item.id)
          <Track key={item.id} name={item.name} artist={item.artist} album={item.album} isRemoval={false}/>
        )*/}
      </div>
    )
  }
}

export default TrackList;
